[{"location":"#Generalized-fiducial-inference-for-logistic-regression","page":"Documentation","title":"Generalized fiducial inference for logistic regression","text":"","category":"section"},{"location":"#Member-functions","page":"Documentation","title":"Member functions","text":"","category":"section"},{"location":"","page":"Documentation","title":"Documentation","text":"Modules = [GFIlogisticRegression]\nOrder   = [:type, :function]","category":"page"},{"location":"#GFIlogisticRegression.fidConfInt","page":"Documentation","title":"GFIlogisticRegression.fidConfInt","text":"fidConfInt(parameter, fidsamples, conf)\n\nFiducial confidence interval of a parameter of interest.\n\nArguments\n\nparameter: an expression of the parameter of interest given as a string; see\n\nthe example\n\nfidsamples: an output of fidSampleLR\nconf: confidence level\n\nExample\n\nusing GFIlogisticRegression, DataFrames, StatsModels\ndata = DataFrame(\n  y = [0, 0, 1, 1, 1, 1],\n  group = [\"A\", \"A\", \"A\", \"B\", \"B\", \"B\"]\n)\nfidsamples = fidSampleLR(@formula(y ~ 0 + group), data, 3000)\nfidConfInt(\":\"group: A\" - :\"group: B\"\", fidsamples, 0.95)\n\n\n\n\n\n","category":"function"},{"location":"#GFIlogisticRegression.fidProb-Tuple{Any,Any,Any}","page":"Documentation","title":"GFIlogisticRegression.fidProb","text":"fidProb(parameter, fidsamples, q)\n\nFiducial non-exceedance probability of a parameter of interest.\n\nArguments\n\nparameter: an expression of the parameter of interest given as a string; see\n\nthe example\n\nfidsamples: fiducial simulations, an output of fidSampleLR\nq: the non-exceedance threshold\n\nExample\n\nusing GFIlogisticRegression, DataFrames, StatsModels\ndata = DataFrame(\n  y = [0, 0, 1, 1, 1],\n  x = [-2, -1, 0, 1, 2]\n)\nfidsamples = fidSampleLR(@formula(y ~ x), data, 3000)\nfidProb(\"map(exp, :x)\", fidsamples, 1) # this is Pr(exp(x) <= 1)\n\n\n\n\n\n","category":"method"},{"location":"#GFIlogisticRegression.fidQuantile-Tuple{Any,Any,Any}","page":"Documentation","title":"GFIlogisticRegression.fidQuantile","text":"fidQuantile(parameter, fidsamples, p)\n\nFiducial quantile of a parameter of interest.\n\nArguments\n\nparameter: an expression of the parameter of interest given as a string; see\n\nthe example\n\nfidsamples: an output of fidSampleLR\np: quantile level, between 0 and 1\n\nExample\n\nusing GFIlogisticRegression, DataFrames, StatsModels\ndata = DataFrame(\n  y = [0, 0, 1, 1, 1, 1],\n  group = [\"A\", \"A\", \"A\", \"B\", \"B\", \"B\"]\n)\nfidsamples = fidSampleLR(@formula(y ~ 0 + group), data, 3000)\nfidQuantile(\":\"group: A\" ./ :\"group: B\"\", fidsamples, 0.5)\n\n\n\n\n\n","category":"method"},{"location":"#GFIlogisticRegression.fidSampleLR","page":"Documentation","title":"GFIlogisticRegression.fidSampleLR","text":"fidSampleLR(formula, data, N[, gmp][, thresh])\n\nFiducial sampling of the parameters of the logistic regression model.\n\nArguments\n\nformula: a formula describing the model\ndata: data frame in which the variables of the model can be found\nN: number of simulations\ngmp: whether to use exact arithmetic in the algorithm\nthresh: the threshold used in the sequential sampler; the default N/2\n\nshould not be changed\n\nExample\n\nusing GFIlogisticRegression, DataFrames, StatsModels\ndata = DataFrame(\n  y = [0, 0, 1, 1, 1],\n  x = [-2, -1, 0, 1, 2]\n)\nfidsamples = fidSampleLR(@formula(y ~ x), data, 3000)\n\n\n\n\n\n","category":"function"},{"location":"#GFIlogisticRegression.fidSummary-Tuple{Any}","page":"Documentation","title":"GFIlogisticRegression.fidSummary","text":"fidSummary(fidsamples)\n\nSummary of the fiducial simulations.\n\nArgument\n\nfidsamples: an output of fidSampleLR\n\nExample\n\nusing GFIlogisticRegression, DataFrames, StatsModels\ndata = DataFrame(\n  y = [0, 0, 1, 1, 1],\n  x = [-2, -1, 0, 1, 2]\n)\nfidsamples = fidSampleLR(@formula(y ~ x), data, 3000)\nfidSummary(fidsamples)\n\n\n\n\n\n","category":"method"}]
